import React from "react";

function Header(){
    return (
        <header className="header">
            <div className="container">
                <div className="row">
                    <div className="col-6">
                        <div className="header_content">
                            <div className="header-section">
                                
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </header>
    )
}
export default Header;
